import React, { Component } from 'react';
import { Layout, Menu, Breadcrumb} from 'antd';
import { Link } from 'react-router-dom';
import {ListContent} from ''


const { Header, Content} = Layout;
class NewList extends Component {
    state = {  }
    render() { 
        return ( 
             <Layout className="layout">
             <Breadcrumb style={{ padding: '2px',background:'#' }}>
        <Breadcrumb.Item>首页</Breadcrumb.Item>
        <Breadcrumb.Item>文章列表</Breadcrumb.Item>
      </Breadcrumb>
    <Header>
      <div className="logo" />
      <Menu
        theme="dark"
        mode="horizontal"
        defaultSelectedKeys={['1']}
        style={{ lineHeight: '64px' }}
      >
        <Menu.Item key="1"><Link to={'/new'}>全部文章</Link></Menu.Item>
        <Menu.Item key="2">已发表</Menu.Item>
        <Menu.Item key="3">草稿箱</Menu.Item>
        <Menu.Item key="4">回收站</Menu.Item>
        <Menu.Item key="5">博客管理</Menu.Item>
        <Menu.Item key="6">博客配置</Menu.Item>
      </Menu>
    </Header>
     <Content>
     <ListContent />
    </Content>
     </Layout>
         );
    }
}
 
export default NewList;
